            WriteLiteral(@"</h2>

<p>A basic implementation of an URL shortener web application using ASP.NET Core MVC and Entity Framework Core.</p>


<h3>Algorithm</h3>

<p>So, how works an URL shortener?</p>

<p>Basicaly, we store the URL in database, so it has a numeric ID, an we convert it to a another base in order to have a ""stringified"" version of the ID.</p>

<p>
When we have the short URL the process is:
    <ul>
        <li>convert the ""stringified"" ID to the numeric ID.</li>
        <li>load the data from DB.</li>
        <li>redirect to the original URL using an HTTP redirection.</li>
    </ul>
</p>

